import React from "react";

const Footer = () => {
  return (
    <div className="footer bg-dark text-light">
      <div className="about">
        <ul>
          <li>
            <h4>About</h4>
          </li>
          <li>History</li>
          <li>Our Team</li>
          <li>Brand Guidelines</li>
          <li>Termes & Condition</li>
          <li>Privacy Policy</li>
        </ul>
      </div>
    </div>
  );
};

export default Footer;
